import React from 'react'
import Nav from './Nav'
import DataDisplay from './DataDisplay'

class App extends React.Component {
  constructor() {
    super();

    this.state = {appDate:Date()}
  }

  componentDidMount() {
    console.log(this.state.appDate)
  }

  render() {
    return(
      <div>
        <Nav />
         <DataDisplay apiData={[3.3176110809420893, 4.18238891905791]}/>  {/* From here can pass in 'data' prop from api call for display in table */}
      </div>
    )
  }
}

export default App;
